INSERT INTO `diseases` VALUES (11,'Fever','DIAGNOSIS: Fever\r\n\r\nTab Zimax 500mg od//Fimoxyl \r\n500mg tds /TabExolev  \r\n500mg od/ cap.Cef-3 200mg \r\nbd /Inj enocef for 5/7days\r\nTab Parapyrol tds  FOR fever\r\nAce suppository 1stick P/R sos(>102f)','Tepid sponging\r\nPlenty water intake','CBC,Widal test,Blood c/s,MP\r\nUrine-R/E',17,'2014-03-05','2014-04-10'),(12,'Common cold ','DIAGNOSIS: Common Cold\r\n\r\nTablet ace tds if fever\r\nTablet neocilor on\r\n','Avoid cold','CBC,Cxr',17,'2014-03-05','2014-04-10'),(13,'Peptic Ulcer Disease','DIAGNOSIS: Peptic Ulcer Disease\r\n\r\nTablet Trupan/ Capsule. Maxpro/ Seclo 20mg bd    for 1 month\r\nTabletlet Entacyd  bd   for 1 month\r\nTablet Butapan/Algin  bd  for pain (10)\r\n','Avoid tea,coffee, smoking, anxiety stress,\r\nempty stomach, spicy-oily food, overnight awake\r\nRegular food habit','Endoscopy of upp.GIT',7,'2014-03-09','2014-04-10'),(14,'Diarrhea','DIAGNOSIS: Diarrhea\r\n\r\nORS/i/v saline\r\nCapsule cef 3 200mg bd/Tablet ciprocin500mg bd/ Capsule doxicap100mg od/Tablet filmet 400mg tds  for 5/7days cap \r\nimotil 2Tablet stat and sos\r\nTablet nospa if needed\r\nTablet onaseron bd\r\nTablet neotack bd \r\nTablet.parapyrol\r\n','Wash hand before eating\r\nDrink pure water','Stool R/E,c/s',7,'2014-03-09','2014-04-10'),(15,'Amoebic Dysentery','DIAGNOSIS: Amoebic Dysentery\r\n\r\nTab Secnid 1g 2tab once/Tab Zox 500mg \r\nbd /Tab Flagyl 400mg tds/Diloxide500mg\r\n tds    for 5/7days\r\nTab Butapan10mg bd/Norvis bd FOR pain\r\nTab Neoceptin R od\r\nORS','Drink pure water \r\nWash hand before eating','Stool R/E',7,'2014-03-09','2014-04-10'),(16,'Bacillary Dysentery','DIAGNOSIS: Bacillary Dysentery\r\n\r\nTablet Cotrim ds bd/Tablet Ciprocin500mgbd/\r\nCapsule cef 3 200mg bd/Eromycin qds\r\nfor 5/7 days\r\nTablet Spanil bd/Tablet.Parapyrol/Motigut bd/Neotack bd if needed\r\n\r\n','Wash hand before eating\r\nDrink pure water','Stool R/E',7,'2014-03-09','2014-04-10'),(17,'Pneumonia','DIAGNOSIS: Pneumonia\r\n\r\nCap moxaclav tds/Tab \r\nzimax500mg/furocef250mg/\r\nFimoxyl500/Sefrad500/\r\nVanprox/loracef/spacin \r\n200mg/Inj megion/Tazid\r\nTab Napa tds FOR fever\r\nTab Piriton bd/Loratin od','Avoid cold moist environment','Cxr, CBC',6,'2014-03-09','2014-04-10'),(18,'Bronchial Asthma','DIAGNOSIS: Bronchial Asthma\r\n\r\nNebulization with ventollin sol./Tab \r\nVentolin 4 mg bd\r\nInhaler ventolin sos/  salflu cozycap bd/ sulprex \r\nbd/beclomin bd\r\nTab cardophylin100mg tds/Tab Contin \r\n400mg  Â½+0+0       continued\r\nInj cotson 1vial i/v sos/Tab Prednisolone\r\n20mg  1+0+0     (6)\r\nÂ½+0+0    (2)\r\nTab Fenadin 60mgbd/Tab Tofen bd\r\nTab ,Montair10mg od','Avoid dust, cold exposure\r\nAvoid particular food which causes allergy/breathlessness','Cxr, Spirometry',6,'2014-03-09','2014-04-10'),(19,'Bronchiolitis','DIAGNOSIS: Bronchiolitis\r\n\r\nNebulization with ventolin sol/Syp.salbutal bd\r\nSyp Tofen/adryl bd\r\nSusp Zymax od/Oracyn k qds/Fimoxyl \r\ntds/Sefrad tds/Vanprox bd/loracef tds\r\nPrednisolone/Dexamethasone','Keep baby warm /dry place with proper \r\nsunlight and ventilation','Cxr P/A view',6,'2014-03-09','2014-04-10'),(20,'Hyper Tension','DIAGNOSIS: Hyper Tension\r\n\r\nTab Betanol 50mg od/Bisocor \r\nplus/Olmecar plus/Camlodin \r\nplus/Ripril plus/Angilock plus 50mg od  \r\nTab relaxen/laxyl at night','Avoid table salt,anxiety\r\nDrugs-steroid,ocp\r\nRegular taking of drugs','ECG,  RBS, HbA1c\r\nLipid profile      S. Creatinin',5,'2014-03-09','2014-04-10'),(21,'Diabetes Mellitus','DIAGNOSIS: Diabetes Mellitus\r\n\r\nTab.comet 500mg od/comprid80mg \r\nod/Secrin2mg/Daonil 5mg od/Tos \r\n15mg od 30 min before meal\r\nTab Neuro B bd /Berin bd','Avoid Sweet/sweetner food\r\nRegular physical activity/walking\r\nLimited CHO\r\nRegular taking of drugs','RBS,FBS,',9,'2014-03-09','2014-04-10'),(22,'Food Poisoning/Gastroenteritis','DIAGNOSIS: Food Poisoning/Gastroenteritis\r\n\r\nORS/i/v infusion\r\nCapsule doxicap od/Tablet quinox 500mg bd/ Capsule cef 3 200mg bd/ \r\nTablet Omidon tds FOR vomiting\r\nTablet butapan 1 mg bd FOR pain\r\nTablet pyralgin bd FOR fever\r\n','Wash hand before eating\r\nAvoid eating food from outside\r\nDrink pure water\r\n','Stool R/E,C/S',7,'2014-03-24','2014-04-10'),(23,'Worms/Helminthic Infestation','DIAGNOSIS: Worms/Helminthic Infestation\r\n\r\nTablet almex400mg 1Tablet single dose\\meben 100mg bd for 3 days\\susp delentin 2tsf single dose','Regular cutting of nail\r\nCleanliness\r\nWash hand with soap before taking food and after defecation\r\n','Stool for r\\e',7,'2014-03-24','2014-04-10'),(24,'Haemorrhoid','DIAGNOSIS: Haemorrhoid\r\n\r\nAnustat/erian/belnovate rectal ointment\r\nTablet Hemorif bd\r\nCapsule SK mox500mg tds\r\nTablet ace/rolac/\r\nEsupgula husk/laxenna/duralex\r\n','Avoid constipation\r\nDrink plenty of water\r\nEat fibre containing food,vegetables\r\nIf external pileswith severe pain /not relieved by conservative rx advice for surgery (longo operation)\r\n','',7,'2014-03-24','2014-04-10'),(25,'Gall Stone','DIAGNOSIS: Gall Stone\r\n\r\nTablet rolac 10mg\\ Capsule anadol 100mg bd\\Tablet tynium bd if pain\r\nCapsule seclo 20mg bd\r\nCapsule roxim200mg bd\r\nTablet sedil on\r\n','Avoid fatty food\r\nSurgery(cholecystectomy)\r\n','USG of HBS including Pancrease\r\nCBC',4,'2014-03-24','2014-04-10'),(26,'Hepatitis','DIAGNOSIS: Hepatitis\r\n\r\nTablet ace bd\r\nTablet deflux bd\r\nOrs\r\nCapsule losectil20mg bd\r\nTablet supravit m od\r\nDextrose \r\n','Drink plenty of water \r\nTake nutritious food,\r\nIntake more CHO  containg food\r\nAvoid fat\r\n','S.Bilirubin,HBsag,\r\nUSG of HBS\r\n',4,'2014-03-24','2014-04-10'),(27,'Urinary Tract Infection','DIAGNOSIS: Urinary Tract Infection\r\n\r\nInj. enocef 2 gm/maxcef/Tablet cotrim ds bd\\Tablet azithroicin 500\\ Capsule cef 3 mg bd for 5\\7 days\r\nTablet ace bd\r\n','Plenty of water intake\r\nAvoid multiple partner\r\nUse protective measure (like condom)\r\n','URINE/R/E, C/S',3,'2014-03-24','2014-04-10'),(28,'Urinary Stone','DIAGNOSIS: Urinary Stone\r\n\r\nInj./Tablet rolac / norvis/anadol/clofenac plus  \r\nTablet napa bd\r\nTablet omidon bd\r\nTablet trupan bd\r\n','Plenty of water intake\r\nsurgery\r\n','Urine R\\E\r\nUSG of KUB\r\nPlain X ray of KUB\r\nCBC\r\n',3,'2014-03-24','2014-04-10'),(29,'Rheumatic Fever','DIAGNOSIS: Rheumatic Fever\r\n\r\nTablet crystapen v 250mg bd   for 5yrs\\inj benzapen 12 lac\r\n1 vial i\\m every 4weeks for 1year\r\nTablet disprin bd after meal if pain\r\nTablet cortan 20mg\r\n','Check ASO titre /4 month','CBC, ASO titre, ECGg,Throat Swab',5,'2014-03-24','2014-04-10'),(30,'Migraine','DIAGNOSIS: Migraine\r\n\r\nTablet ace plus bd\r\nTablet migranil .5mg\r\nTablet tryptin 25 mg\r\nTablet indever\r\nTablet nixalo .25mg\r\n','Avoid triggering factors like anxiety,stress,particular food,insomnia,noise,light','X-ray PNS OM view',2,'2014-03-24','2014-04-10'),(31,'Gout','DIAGNOSIS: Gout\r\n\r\nTablet napa 500mg/Tablet inflam400mg/Tablet flexi bd/ Capsule indomet 25 mg bd/sonap 500mg bd/melcam/flexicam\r\nTablet esloric 100 mg od\r\nTablet neoceptin R bd\r\n','Avoid meat/fish/aspirin/diuretics/alcohol\r\nOr other precipitating factors\r\n','CBC,s.urate\r\nXray of affected joint\r\nSynovial fluid analysis\r\n',10,'2014-03-24','2014-04-10'),(32,'Anemia','DIAGNOSIS: Anemia\r\n\r\nTablet folfetab bd/ Capsule feofol bd/ Capsule zif od/Tablet ziliron od/Inj Imferon\r\nTablet supravit M od\r\nBT if severe\r\n','Eat fresh vegetables/fruit','CBC, S.iron',12,'2014-03-24','2014-04-10'),(33,'Tineasis','DIAGNOSIS: Tineasis\r\n\r\nAfun/pevaryl/pevisone/fungidal HC /betnovate cl cream bd\r\nCapsule  flugal 50 mg od\r\nTablet alatrol on\r\n','Maintain cleanliness\r\nWashing/Changes of cloth regularly\r\n','Skin scraping for r/e',13,'2014-03-24','2014-04-10'),(34,'Scabies','DIAGNOSIS: Scabies\r\n\r\nLorix/scabex cream all over body except face \r\nWash after 24 hrs\r\nTablet alatrol on\r\n','Washing of cloth /bedsheet with boiled water\r\nRx of other affected member\r\n','',13,'2014-03-24','2014-04-10'),(35,'Syphilis','DIAGNOSIS: Syphilis\r\n\r\nCapsule doxicap  /inj dipen  i/m for 15 days ','Avoid unprotected sexual contact\r\nPractice  religious activity\r\n','VDRL/TPHA',14,'2014-03-24','2014-04-10'),(36,'Gonorrhea','DIAGNOSIS: Gonorrhea\r\n\r\nTablet cotrim ds bd\\Tablet azithroicin 500\\ Capsule cef 3 mg for 5\\7 days /inj ceftron 2gm od \r\nTablet ace bd\r\n','Avoid unprotected sexual contact\r\nPractice  religious activity\r\nPlenty of water intake\r\n','URINE â€“R/E,C/S\r\nURETHRAL DISCHARGE\r\n',14,'2014-03-24','2014-04-10'),(37,'Conjunctivitis','DIAGNOSIS: Conjunctivitis\r\n\r\nCiprocin/iventi/mexlo /stenicol/aprodex eye drop 2 drops tds\r\nTablet ordain on\r\n','Avoid day light  exposure\r\nWear  sun glass\r\n','Conjunctival swab for c/s',15,'2014-03-24','2014-04-10'),(38,'Tonsillitis','DIAGNOSIS: Tonsillitis\r\n\r\nCapsule fimoxyl 500mg tds/Tablet trevox 500mg  od\\Tablet azithroicin 500 od\\ Capsule sefrad 500mg tds for 5\\7 days\r\nTablet piriton  bd\r\nTablet ace bd\r\n','Avoid cold exposure,cold water/drinks ,\r\nIf frequent attack after taking several group of antibiotics surgery is adviced(tonsillectomy)\r\n','Throat Swab  for c/s',16,'2014-03-24','2014-04-10'),(39,'Sinusitis','DIAGNOSIS: Sinusitis\r\n\r\nCapsule fimoxyl 500mg tds/Tablet trevox 500mg  od\\Tablet azithroicin 500 od\\cap sefrad 500mg tds for 5\\7 days\r\nMenthol/antazol/decomit nasal spray\r\nTablet ace plus bd\r\nTablet piriton  bd','Avoid cold exposure','Xray PNS OM VIiew',16,'2014-03-24','2014-04-10'),(40,'CSOM','DIAGNOSIS: CSOM\r\n\r\nCapsule fimoxyl 500mg tds/Tablet trevox 500mg  od\\Tablet azithroicin 500 od\\ Capsule sefrad 500mg tds/roxim 200mg bd for 5\\7 days\r\nChlorphen/Ciprocin /polycort ear drop 2drops tds\r\nTablet piriton  bd\r\nTablet ace bd\r\n','Regular Aural toileting\r\nAvoid entry of water into ear\r\nAvoid swimming/diving\r\nIf relapse frequently after taking several  groups of antibiotics advice for surgery myringoplasty (repair of tympanic membrane)\r\n','Aural swab for c/s',16,'2014-03-24','2014-04-10');
