INSERT INTO `Form` VALUES (1,'2014-03-25 15:28:27',112,'','','2014-05-18 16:21:35','Patient Registration',1,'<?xml version=\"1.0\"?>\r\n<h:html xmlns=\"http://www.w3.org/2002/xforms\" xmlns:ev=\"http://www.w3.org/2001/xml-events\" xmlns:h=\"http://www.w3.org/1999/xhtml\" xmlns:jr=\"http://openrosa.org/javarosa\" xmlns:orx=\"http://openrosa.org/xforms/\" xmlns:xsd=\"http://www.w3.org/2001/XMLSchema\">\r\n<h:head>\r\n<h:title>Patient Registration</h:title>\r\n<model>\r\n<instance>\r\n<data id=\"1\">\r\n<i_start_time/>\r\n<Patient_Image/>\r\n<firstPage>\r\n<Patient_Name/>\r\n<mobile/>\r\n<Patient_MobileNo/>\r\n</firstPage>\r\n<SecondPage>\r\n<Age_note/>\r\n<Patient_Age_Year/>\r\n<Patient_Age_Month/>\r\n<Patient_Age_Day/>\r\n<gender/>\r\n<Patient_Gender/>\r\n</SecondPage>\r\n<Patient_ID/>\r\n<i_end_time/>\r\n</data>\r\n</instance>\r\n<itext>\r\n<translation lang=\"english\">\r\n<text id=\"/data/Patient_Image:label\"><value>রোগীর ছবি তুলুন</value></text>\r\n\r\n<text id=\"/data/firstPage:label\"><value></value></text>\r\n<text id=\"/data/firstPage/Patient_Name:label\"><value>রোগীর নাম লিখুন</value></text>\r\n<text id=\"/data/firstPage/mobile:label\"><value></value></text>\r\n<text id=\"/data/firstPage/Patient_MobileNo:label\"><value>রোগীর ফোন নম্বর লিখুন</value></text>\r\n\r\n<text id=\"/data/SecondPage:label\"><value>রোগীর বয়স</value></text>\r\n<text id=\"/data/SecondPage/Age_note:label\"><value>রোগীর বয়স ২ বছরের কম হলে \"মাস\" প্রযোজ্য এবং ২ মাসের কম হলে \"দিন\" প্রযোজ্য। বয়স ১ বছরের কম হলে বছরের ঘরে \'০\' লিখুন এবং প্রযোজ্য ক্ষেত্রে \'মাস\'এর ঘরে কত মাস এবং \'দিন\' এর ঘরে কত দিন তা লিখুন</value></text>\r\n<text id=\"/data/SecondPage/Patient_Age_Year:label\"><value>রোগীর বয়স (বছর)</value></text>\r\n<text id=\"/data/SecondPage/Patient_Age_Month:label\"><value>রোগীর বয়স (মাস)</value></text>\r\n<text id=\"/data/SecondPage/Patient_Age_Day:label\"><value>রোগীর বয়স (দিন)</value></text>\r\n<text id=\"/data/SecondPage/gender:label\"><value></value></text>\r\n<text id=\"/data/